import React from 'react'

const Error = () => {
    return (
        <div className="container">
            <div className="row">
                <div className="col mt-5">
                <div class="alert alert-danger" role="alert">
                 Sorry your payment was not successful.
                </div>
                </div>

            </div>
            
        </div>
    )
}

export default Error;
